  return (
    <View
      style={{ top: 24, width: 61, height: 24, left: 23, marginBottom: 24 }}
    >
      {IsNewRecord ? (
        <Text style={{ fontSize: 16, fontWeight: "700" }}>폴더 추가</Text>
